// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.4;

contract EthersWallet {

    event Transfered(bool,bytes);
    event Transferring(address,address,uint);

    address private owner;
    mapping(address => uint) internal balances;

    modifier isOwner() {
        require(msg.sender == owner, "Not the Owner");
        _;
        }

    constructor() {
        owner = msg.sender;
    }

    // fallback() external payable{
    //     balances[msg.sender] += msg.value;  
    // }

    receive() external payable{
        balances[msg.sender] += msg.value;
    }


    function changeBalance(address _to,address _from, uint256 _value) external payable{

        balances[_to] += msg.value;
        balances[_from] -= _value;

        emit Transferring(_to,_from,_value);

    }

    function withdraw(address _to,address _from, uint _value) external isOwner {

       (bool success, bytes memory data) = _to.call{value: _value}(abi.encodeWithSignature("changeBalance(address,address,uint256)", _to, _from, _value));
        emit Transfered(success,data);
        // balances[_to] += _value;
        // balances[_from] -= _value;

    }

    function userBalance() external view returns(uint){
        return balances[msg.sender];
    }
}

